import React from "react";
import BackgroundImage from "../../features/BackgroundImage";
import BackgroundYoutube from "../../features/BackgroundYoutube";
import logo from "../../imgs/logo-min.png";
import styles from "./HomePage.module.css";

function HomePage() {
  return (
    <div className={styles.homepage}>
      <div className="styles.callToAction"></div>
      <h1 className={styles.h1}>
        Forget your classes office hours, just{" "}
        <img className={styles.img} src={logo} /> it
      </h1>
      <div className={styles.background_video}>
        <BackgroundYoutube className="homepage_video" embedId="wY55CdGx4H0" />
      </div>
      {
        //<BackgroundImage />
      }
    </div>
  );
}

export default HomePage;
